import React, { useState } from 'react'


export default function SearchBar() {

    const [search, changeSearch] = useState("hello world")

    function updateSearch(event) {
        changeSearch(prevSearch => event.target.value)
    }

    return (
        <input 
            type='text' 
            value={search}
            onChange={updateSearch}
        />
    )
}
